%[text] # Low code time series and geospatial data handling, analysis and visualization
%[text] ## Download data from Kaggle: [https://www.kaggle.com/datasets/decide-soluciones/air-quality-madrid](https://www.kaggle.com/datasets/decide-soluciones/air-quality-madrid) 
%[text] - madrid\_2018.csv
%[text] - stations.csv \
%%
%[text] ## Use the Import Data App to 
%[text] ### import "madrid\_2018.csv", then preview the File
madrid = importAirquality("madrid_2018.csv");
madrid = sortrows(madrid,"NO","ascend") %[output:7869b012]


figure
scatter(madrid.NO,madrid.NOx)
xlabel("NO");
ylabel("NOx");
title("NOx vs NO");
legend("show");
set(gcf, "Theme", "light");
data1 = findobj(gcf,"DisplayName","data1") %[output:914afe9f]
data1.LineWidth = 1 %[output:6462715a]
%%
%[text] ## Unstack Table Variable
% Unstack variables %[task:6326]
unstackedTable = unstack(madrid,"BEN","station",AggregationFunction=@mean, ... %[output:group:6d92047a] %[output:5d23560f]
    VariableNamingRule="preserve") %[task:6326] %[output:group:6d92047a] %[output:5d23560f]
%%
%[text] ## Clean Missing Data
% Fill missing data %[task:7236]
[cleanedData,missingIndices] = fillmissing(madrid_2018.NO_2,"movmedian",5);

% Display results
figure %[output:8549e56f]

% Plot cleaned data
plot(cleanedData,SeriesIndex=1,LineWidth=1.5,DisplayName="Cleaned data") %[output:8549e56f]
hold on %[output:8549e56f]

% Plot filled missing entries
plot(find(missingIndices),cleanedData(missingIndices),".",MarkerSize=12, ... %[output:8549e56f]
    SeriesIndex=2,DisplayName="Filled missing entries") %[output:8549e56f]
title("Number of filled missing entries: " + nnz(missingIndices)) %[output:8549e56f]

hold off %[output:8549e56f]
legend %[output:8549e56f]
clear missingIndices %[task:7236]
%%
%[text] ## Check out the stations location
%[text] ### import "stations.csv", then preview the File
%[text] Transform the "id" variable from *Double* to *String*
hold off %[output:9e6000f0]
%%
%[text] ### Create a Plot - to plot the Stations on a map
% Create geoscatter of stations.lat and stations.lon %[task:3edd]
S = geoscatter(stations.lat,stations.lon); %[output:1051f082]

% Add title
title("stations.lat vs. stations.lon") %[task:3edd] %[output:1051f082]
hold on %[output:1051f082]
geobasemap('satellite') %[output:1051f082]

ax = gca; %[output:1051f082]
chart = ax.Children(1); %[output:1051f082]
datatip(chart,40.5,-3.69); %[output:1051f082]
%%
%[text] ## Change the geobasemap and fill the circles 
%[text] Ask [MATLAB GPT](https://chatgpt.com/g/g-QFTjbeK3U-matlab) or [MATLAB AI Chat Playground](https://uk.mathworks.com/matlabcentral/playground/new) to "change the format of degrees in the geographic plot"
%[text] (check the documentation!)

%%
%[text] ## Ask Copilot how to add station labels
%[text] "Can you add in the figure the text label (id) for the stations? Don't use a for loop"
%[text] *`(Make sure "lat" is the first argument and "lon" the second one!!)`*


%[text] Add a Colorbar (you can import a colormap from the IPCC [Standard-Climate-Colormaps-for-MATLAB - File Exchange - MATLAB Central](https://uk.mathworks.com/matlabcentral/fileexchange/180750-standard-climate-colormaps-for-matlab))
figure %[output:9382a828]
load("coastlines.mat")

axesm('MapProjection','robinson','MapLatLimit',[30 45],'MapLonLimit',[-20 10],'Frame', 'on', 'Grid', 'on') %[output:9382a828]
scatterm(stations.lat,stations.lon,40,stations.elevation,"filled","o") %[output:9382a828]

% Set the limits for the map
setm(gca, 'ParallelLabel', 'on', 'MeridianLabel', 'on'); %[output:9382a828]

% Optionally, customize grid appearance
setm(gca, 'GColor', 'k'); % Set grid color to black %[output:9382a828]
setm(gca, 'GLineStyle', '-'); % Set grid line style %[output:9382a828]
% Set meridian interval to 2 degrees
setm(gca, 'MeridianInterval', 2); %[output:9382a828]

gca()
